import React, { useEffect, useState } from 'react';
import axios from 'axios';
import './PlayerStats.css';

const PlayerStats = () => {
  const playerId = localStorage.getItem('playerId'); // Retrieve playerId from localStorage
  const username = localStorage.getItem('username'); // Retrieve username from localStorage

  const [playerStats, setPlayerStats] = useState([]);
  const [teamStats, setTeamStats] = useState([]);
  const [showTeamStats, setShowTeamStats] = useState(false);

  // Fetch player stats when component mounts
  useEffect(() => {
    if (!playerId || !username) {
      console.error('Player ID or Username is missing');
      return;
    }

    // Fetch player stats using playerId
    axios
      .get(`http://localhost:5001/api/playerStats/${playerId}`)
      .then((response) => {
        setPlayerStats(response.data); // Update state with fetched stats
      })
      .catch((error) => {
        console.error('Error fetching player stats:', error);
      });
  }, [playerId, username]); // Only re-run the effect if playerId or username changes

  // Fetch team stats when the "View Team Stats" button is clicked
  const handleViewTeamStats = () => {
    if (playerStats.length > 0) {
      const teamId = playerStats[0]?.Team_ID; // Assuming Team_ID is in playerStats
      axios
        .get(`http://localhost:5001/api/teamStats/${teamId}`)
        .then((response) => {
          setTeamStats(response.data);
          setShowTeamStats(true);
        })
        .catch((error) => {
          console.error('Error fetching team stats:', error);
        });
    }
  };

  return (
    <div className="player-stats">
      {/* Display a welcome message if playerId and username exist */}
      {username ? (
        <h2>Welcome, {username}!</h2>
      ) : (
        <h2>Welcome, Unidentified Player!</h2>
      )}

      <h3>Player Stats</h3>
      {playerStats.length === 0 ? (
        <p>No player stats available</p> // Handle case when stats are not found
      ) : (
        <table>
          <thead>
            <tr>
              <th>Sport</th>
              <th>Wins</th>
              <th>Points Scored</th>
              <th>Goals Scored</th>
            </tr>
          </thead>
          <tbody>
            {playerStats.map((stat, index) => (
              <tr key={index}>
                <td>{stat.Sport_Name}</td>
                <td>{stat.Wins}</td>
                <td>{stat.Points_scored}</td>
                <td>{stat.Goals_scored}</td>
              </tr>
            ))}
          </tbody>
        </table>
      )}

      {/* Button to show team stats */}
      <button onClick={handleViewTeamStats}>View Team Stats</button>

      {showTeamStats && (
        <div>
          <h3>Team Stats</h3>
          <table>
            <thead>
              <tr>
                <th>Sport</th>
                <th>Wins</th>
                <th>Points Scored</th>
                <th>Goals Scored</th>
              </tr>
            </thead>
            <tbody>
              {teamStats.map((stat, index) => (
                <tr key={index}>
                  <td>{stat.Sport_Name}</td>
                  <td>{stat.Wins}</td>
                  <td>{stat.Points_scored}</td>
                  <td>{stat.Goals_scored}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      )}
    </div>
  );
};

export default PlayerStats;
